import React, { useEffect, useState } from 'react';
import axios from 'axios';


export const MeasuringData = ({standId}) =>{

const [data, setData] = useState([])
let dataList = []

useEffect(() => {

  axios.get(`/measuring-data/${standId}`)
  .then((res) => {
    setData(res.data);
  })
});

   dataList = data.map(sta => {
    return (
      <div key={sta.id} className='station-card' >

      </div>
    )
  })



  return(
    <div>
  {dataList}
  </div>
  )
}
